import React, { Component } from "react";
import "./App.css";
import SingleMeetingAnalysisContainer from "./features/singleMeetingAnalysis/SingleMeetingAnaylsisContainer";
import { BrowserRouter as Router, Route } from "react-router-dom";
import LoginContainer from "./features/login/LoginContainer";

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <Route exact path="/" component={LoginContainer} />
          <Route
            path="/singleMeeting"
            component={SingleMeetingAnalysisContainer}
          />
          <Route path="/dashboard" component={SingleMeetingAnalysisContainer} />
        </div>
      </Router>
    );
  }
}

export default App;
